  false,\n\t\"url\": null,\n\t\"notes\": \"<p>This annual report summarizes impacts
  from the Initiative to Reduce Avoidable Hospitalizations among Nursing Facility
  Residents in 2014. This initiative is designed to test ways to reduce avoidable
  hospitalizations among long-stay nursing facility residents. For such individuals,
  avoidable hospitalizations can be dangerous, disruptive, and disorienting. The results
  in this report are based on experience during the second performance year of the
  initiative, calendar year 2014.</p>n\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
